-- Name: instanciar_form(integer); Type: FUNCTION; Schema: public; Owner: arbolado
--

CREATE FUNCTION public.instanciar_form(p_form_id integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$
declare
	v_info_id public.frm_instancias_formularios.info_id%type;
begin
	
with inserted_instances as (
insert
	into
		public.frm_instancias_formularios(label,
		name,
		requerido,
		tida_id,
		form_id,
		orden,
		info_id,
		mostrar,
		cond_mostrar,
		deshabilitado,
		cond_habilitado,
		valo_id)
		select
			label,
			name,
			requerido,
			tida_id,
			form_id,
			orden,
			(
			select
				coalesce(max(info_id),
				0)+ 1 as info_id
			from
				public.frm_instancias_formularios),
			mostrar,
			cond_mostrar,
			deshabilitado,
			cond_habilitado,
			valo_id
		from
			frm_items
		where
			frm_items.form_id =p_form_id
			and frm_items.eliminado = 0
		order by
			frm_items.orden returning info_id) 
			
			
	select distinct(info_id) 
	into strict v_info_id
	from inserted_instances;

	return v_info_id;
	
	end;
	$$;


ALTER FUNCTION public.instanciar_form(p_form_id integer) OWNER TO arbolado;

